    MOD = 1000000008
    dp = [[[0, 0] for _ in range(k + 1)] for _ in range(n + 1)]
    dp[1][0][0] = 1
    dp[1][0][1] = 1
    for i in range(2, n + 1):
        for j in range(k + 1):
            dp[i][j][0] = (dp[i - 1][j][0] + dp[i - 1][j][1]) % MOD
            dp[i][j][1] = dp[i - 1][j][0]
